135→/// Local environment controller.
136→public struct Environment: Environmenting {
137→    @TaskLocal public static var current: Environmenting = Environment()
138→
139→    public var processId: String
140→    public var variables: [String: String]
141→    public var arguments: [String]
142→
143→    public init(
144→        processId: String = UUID().uuidString,
145→        variables: [String: String] = ProcessInfo.processInfo.environment,
146→        arguments: [String] = ProcessInfo.processInfo.arguments
147→    ) {
148→        self.processId = processId
149→        self.variables = variables
150→        self.arguments = arguments
151→    }
152→
153→    public var homeDirectory: AbsolutePath {
154→        // swiftlint:disable force_try
155→        try! AbsolutePath(validating: NSHomeDirectory())
156→    }
157→
158→    public var isJSONOutput: Bool {
159→        return arguments.contains("--json")
160→    }
161→
162→    /// Returns true if the output of Tuist should be coloured.
163→    public var shouldOutputBeColoured: Bool {
164→        let noColor =
165→            if let noColorEnvVariable = variables["NO_COLOR"] {
166→                truthyValues.contains(noColorEnvVariable)
167→            } else {
168→                false
169→            }
170→        let ciColorForce =
171→            if let ciColorForceEnvVariable = variables["CLICOLOR_FORCE"] {
172→                truthyValues.contains(ciColorForceEnvVariable)
173→            } else {
174→                false
175→            }
176→        if noColor {
177→            return false
178→        } else if ciColorForce {
179→            return true
180→        } else {
181→            let isPiped = isatty(fileno(stdout)) == 0
182→            return !isPiped
183→        }
184→    }
185→
186→    /// Returns true if the environment represents a GitHub Actions environment
187→    public var isGitHubActions: Bool {
188→        if let githubActions = variables["GITHUB_ACTIONS"] {
189→            return truthyValues.contains(githubActions)
190→        } else {
191→            return false
192→        }
193→    }
194→
195→    /// Returns true if the standard output is interactive.
196→    public var isStandardOutputInteractive: Bool {
197→        let termType = variables["TERM"]
198→        if let t = termType, t.lowercased() != "dumb", isatty(fileno(stdout)) != 0 {
199→            return true
200→        }
201→        return false
202→    }
203→
204→    public var isVerbose: Bool {
205→        guard let variable = variables[
206→            "TUIST_CONFIG_VERBOSE"
207→        ]
208→        else { return false }
209→        return truthyValues.contains(variable)
210→    }
211→
212→    public var isStatsEnabled: Bool {
213→        guard let variable = variables[
214→            "TUIST_CONFIG_STATS_OPT_OUT"
215→        ]
216→        else { return true }
217→        let userOptedOut = truthyValues.contains(variable)
218→        return !userOptedOut
219→    }
