229→    public var cacheDirectory: AbsolutePath {
230→        let baseCacheDirectory: AbsolutePath
231→        if let cacheDirectoryPathString = variable("XDG_CACHE_HOME"),
232→           let cacheDirectory = try? AbsolutePath(validating: cacheDirectoryPathString)
233→        {
